import { Outlet } from "react-router-dom";


export default function Rootlayout() {
  return (
    <>


<MobileNav />
       <MainNavigation />
       <Navigation />
       <MainSection />
       <Welcome />
       <Courses />
       <Form />
       <Footer />

      <main>
        <Outlet />
      </main>
    </>
  );
}
